import React from "react";
import innum from '../images/innum.png'
import '../App.css'

export default function Navbar(){
    return(
        <div className='bg-black h-32'>
            <div className="flex justify-start translate-y-3 translate-x-3">
                <img src={innum} alt="innum" className="w-24"/>
            </div>         
            <div className="font-black text-white translate-x-28 translate-y">
                <p>Innum Vai!!!</p>
                <p>Happy Tummy Ahead!!!</p>
            </div>   
        </div>
    )
}
